import React from "react";

const TerraformMigration = () => {
  return (
    <div className="portfolio-detail">
      <h1>Terraform Multi-Cloud Migration</h1>
      <p>
        A comprehensive project showcasing the use of Terraform to orchestrate the migration of
        workloads between AWS and GCP. Focuses on IaC best practices and cloud automation.
      </p>
      <img src="/assets/terraform-migration.png" alt="Terraform Multi-Cloud Migration" />
    </div>
  );
};

export default TerraformMigration;
